INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 122601, 101, 1, 0, 110, 0, 1, 105, 0.029, 1, 1, 1.5, 160);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 122401, 102, 3, 0, 105, 1, 2, 111, 0.014, 2, 0, 2.5, 120);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 122501, 103, 2, 1, 110, 0, 3, 105, 0.017, 3, 0, 2.5, 350);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 107501, 104, 3, 0, 110, 1, 4, 105, 0.016, 4, 0, 1.5, 130);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 107601, 105, 1, 0, 110, 0, 5, 105, 0.014, 5, 1, 2.5, 160);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 107801, 106, 2, 1, 120, 0, 6, 103, 0.029, 6, 0, 3.5, 255);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 110601, 107, 1, 0, 120, 0, 7, 103, 0.013, 7, 1, 3.5, 160);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 110401, 108, 2, 1, 110, 0, 8, 103, 0.014, 8, 0, 2.5, 350);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 110501, 109, 3, 0, 105, 1, 9, 100, 0.012, 9, 0, 1.5, 130);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 115701, 110, 1, 0, 105, 0, 10, 103, 0.014, 10, 1, 2.5, 200);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 113601, 111, 2, 1, 105, 0, 11, 103, 0.071, 11, 0, 2.5, 350);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 107901, 112, 3, 0, 120, 1, 12, 103, 0.014, 12, 0, 1.5, 130);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 108001, 113, 2, 0, 110, 0, 13, 105, 0.022, 13, 1, 1.5, 200);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 110301, 114, 1, 0, 110, 0, 14, 108, 0.031, 14, 1, 2.5, 160);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 107701, 115, 1, 0, 110, 1, 15, 105, 0.036, 15, 0, 0.5, 130);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 113101, 116, 2, 1, 110, 0, 16, 95, 0.048, 16, 0, 3.5, 350);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 113301, 117, 3, 0, 105, 1, 17, 105, 0.043, 17, 0, 1.5, 130);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 113201, 118, 2, 0, 105, 1, 18, 95, 0.018, 18, 0, 1.5, 130);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 117001, 119, 2, 0, 110, 0, 19, 108, 0.021, 19, 1, 2.5, 160);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 113501, 120, 1, 1, 110, 0, 20, 105, 0.036, 20, 0, 2.5, 255);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 113401, 121, 3, 1, 105, 0, 21, 105, 0.02, 21, 0, 2.5, 350);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 110101, 122, 1, 0, 110, 1, 22, 105, 0.018, 22, 0, 2.5, 130);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 110001, 123, 3, 0, 105, 0, 23, 111, 0.03, 23, 1, 3.5, 160);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 117201, 124, 1, 0, 110, 1, 24, 103, 0.027, 24, 0, 1.5, 130);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 117301, 125, 2, 0, 105, 0, 25, 108, 0.02, 25, 1, 3.5, 160);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 117401, 126, 3, 1, 110, 0, 26, 105, 0.04, 26, 0, 2.5, 350);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 117101, 127, 1, 1, 110, 0, 27, 105, 0.009, 27, 0, 3.5, 350);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 122901, 128, 1, 1, 120, 0, 28, 105, 0.022, 28, 0, 3.5, 255);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 122801, 129, 3, 0, 110, 1, 29, 105, 0.028, 29, 0, 2.5, 130);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES ("海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 122701, 130, 2, 0, 105, 0, 30, 108, 0.023, 30, 1, 3.5, 130);
